import React from 'react'

export const PopUp = ({isOpen}) => {
    const onClickBtn = () => {
        isOpen = false;
    }
    const Overlay = document.querySelector('#popup')
    return (
        <div>
            <Overlay class="overlay"/>
            <div class="popup">
                <p>Title</p>
                <div class="popup_inner"></div>
                <button onClick={onClickBtn}>Начать игру</button>
            </div>
        </div>
    )
}
